import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';

const VillaDetail = () => {
  const { id } = useParams();
  const [villaData, setVillaData] = useState(null);
  const [selectedSpace, setSelectedSpace] = useState(null);
  const [currentUser, setCurrentUser] = useState(null);
  const [exitTime, setExitTime] = useState('');
  const [notes, setNotes] = useState('');
  const [modalOpen, setModalOpen] = useState(false);
  const navigate = useNavigate();

  const fetchVilla = async () => {
    try {
      const response = await axios.get(`http://localhost:3001/api/villa/${id}`);
      setVillaData(response.data);
    } catch (error) {
      console.error('Error fetching villa details:', error);
    }
  };

  const fetchCurrentUser = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/user/current', { withCredentials: true });
      setCurrentUser(response.data);
    } catch (error) {
      console.error('Error fetching current user:', error);
    }
  };

  useEffect(() => {
    fetchVilla();
    fetchCurrentUser();
  }, []);

  const handleSpaceClick = (space) => {
    if (space.type === 'PARKING') {
      setSelectedSpace(space);
      setModalOpen(true);
    }
  };

  const handleSubmit = async () => {
    if (!selectedSpace || !currentUser) {
      console.error('No space or user selected');
      return;
    }

    const updatedSpace = {
      ...selectedSpace,
      exitTime,
      notes,
      isOccupied: true,
      userId: currentUser.id,
      vehicleName: currentUser.vehicleName,
      vehicleNumber: currentUser.vehicleNumber,
      contact: currentUser.phone,
    };

    try {
      await axios.post(
        `http://localhost:3001/api/villa/${id}/update-space/${selectedSpace._id}`,
        updatedSpace,
        { withCredentials: true }
      );
      setVillaData((prevData) => {
        const newSpaces = prevData.spaces.map((space) =>
          space._id === selectedSpace._id ? updatedSpace : space
        );
        return { ...prevData, spaces: newSpaces };
      });
      setModalOpen(false);
    } catch (error) {
      console.error('Error updating parking space:', error);
    }
  };

  const handleExit = async () => {
    if (!selectedSpace || !currentUser) {
      console.error('No space or user selected');
      return;
    }

    const updatedSpace = {
      ...selectedSpace,
      isOccupied: false,
      exitTime: '',
      notes: '',
      userId: null,
      vehicleName: '',
      vehicleNumber: '',
      contact: '',
    };

    try {
      await axios.post(
        `http://localhost:3001/api/villa/${id}/update-space/${selectedSpace._id}`,
        updatedSpace,
        { withCredentials: true }
      );
      setVillaData((prevData) => {
        const newSpaces = prevData.spaces.map((space) =>
          space._id === selectedSpace._id ? updatedSpace : space
        );
        return { ...prevData, spaces: newSpaces };
      });
      setModalOpen(false);
    } catch (error) {
      console.error('Error updating parking space:', error);
    }
  };

  const handleGoToMain = () => {
    navigate('/main');
  };

  if (!villaData) {
    return (
      <div>
        등록된 빌라가 없습니다.
        <button onClick={handleGoToMain}>메인 페이지로</button>
      </div>
    );
  }

  return (
    <div>
      <h2>빌라 상세 정보</h2>
      <p>빌라 이름: {villaData.villaName}</p>
      <p>주소: {villaData.address}</p>
      <div>
        {villaData.spaces.map((space) => (
          <div
            key={space._id}
            style={{ border: '1px solid black', margin: '10px', padding: '10px' }}
            onClick={() => handleSpaceClick(space)}
          >
            <p>타입: {space.type}</p>
            <p>위치: ({space.left}, {space.top})</p>
            <p>크기: {space.width} x {space.height}</p>
            <p>{space.isOccupied ? '주차중' : '빈 칸'}</p>
          </div>
        ))}
      </div>
      {modalOpen && (
        <div>
          <h3>주차 공간 정보</h3>
          <p>타입: {selectedSpace.type}</p>
          <p>위치: ({selectedSpace.left}, {selectedSpace.top})</p>
          <p>크기: {selectedSpace.width} x {selectedSpace.height}</p>
          {selectedSpace.isOccupied ? (
            <>
              <p>차종: {selectedSpace.vehicleName}</p>
              <p>차번호: {selectedSpace.vehicleNumber}</p>
              <p>연락처: {selectedSpace.contact}</p>
              <button onClick={handleExit}>출차하기</button>
            </>
          ) : (
            <>
              <label>출차 시간: </label>
              <input
                type="text"
                value={exitTime}
                onChange={(e) => setExitTime(e.target.value)}
              />
              <label>특이사항: </label>
              <input
                type="text"
                value={notes}
                onChange={(e) => setNotes(e.target.value)}
              />
              <button onClick={handleSubmit}>주차하기</button>
            </>
          )}
          <button onClick={() => setModalOpen(false)}>닫기</button>
        </div>
      )}
    </div>
  );
};

export default VillaDetail;
